INSERT INTO `yzapp_article` VALUES (20,'厦门9-10职位分析','本文是关于厦门职位的Java,C++/C#,Python,PHP,Android,IOS,Web等职位的数据分析，共采集500多个岗位进行分析的数据，分析内容主要为厦门的职位需求分析，厦门职位学历要求分析，厦门职位工作经验要求分析和厦门职位入职工资分析','2018-01-06 11:14:21','2018-03-06 06:23:25',1,0,2,0,'biliyang'),(26,'厦门大专与本科职位分析','本文是厦门关于Java,C/C++,.Net,Python,PHP,Android,IOS等职位的大专与本科职位分析，内容暂时分析出了大专与本科的入职工资分析图，大专与本科的各岗位职位需求图','2018-01-06 16:53:18','2018-01-20 21:06:05',1,0,0,1,'biliyang'),(27,'专科与本科工作经验与工资待遇','主要内容为专科与本科工作经验为不限的工资待遇对比分析，专科与本科工作经验为1-3年的工资待遇对比分析，专科工资经验为1-3年与本科工资经验为不限的工资对比分析','2018-01-07 08:31:56','2018-01-20 21:05:07',1,0,0,1,'biliyang');
